import React from 'react';
import './App.css';
import { ReactComponent as CoursesSvg } from './assets/noun_Folder_3415647.svg'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div className="App-logo">
          LEVEL
        </div>
      </header>
      <div className="sidenav">
        <div className="courses-div">
          <CoursesSvg />
        </div>
      </div>
    </div>
  );
}

export default App;
